import React, { useState } from 'react';

const FindMusic = () => {
  const [selectedGenre, setSelectedGenre] = useState('');
  const [tempo, setTempo] = useState('');
  const [popularity, setPopularity] = useState('Niche');
  const [recommendedTracks, setRecommendedTracks] = useState([]);
  const [isLoading, setIsLoading] = useState(false);

  const popularityValues = {
    Niche: { min: 0, max: 25 },
    Underground: { min: 26, max: 50 },
    Popular: { min: 51, max: 75 },
    VeryPopular: { min: 76, max: 100 },
  };

  const handleGenreChange = (event) => {
    setSelectedGenre(event.target.value);
  };

  const handleTempoChange = (event) => {
    setTempo(event.target.value);
  };

  const handlePopularityChange = (event) => {
    setPopularity(event.target.value);
  };

  const fetchRecommendations = async () => {
    setIsLoading(true);

    const accessToken = localStorage.getItem('access_token');
    const params = {
      seed_genres: selectedGenre || undefined,
      min_tempo: tempo === 'fast' ? 120 : tempo === 'slow' ? 60 : 90,
      max_tempo: tempo === 'fast' ? 180 : tempo === 'slow' ? 90 : 120,
      min_popularity: popularityValues[popularity].min,
      max_popularity: popularityValues[popularity].max,
      limit: 10,
    };

    const queryParams = new URLSearchParams(params).toString();
    const url = `https://api.spotify.com/v1/recommendations?${queryParams}`;

    try {
      const response = await fetch(url, {
        headers: {
          Authorization: `Bearer ${accessToken}`,
        },
      });
      const data = await response.json();
      setRecommendedTracks(data.tracks);
    } catch (error) {
      console.error('Error fetching recommended tracks:', error);
    } finally {
      setIsLoading(false);
    }
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    fetchRecommendations();
  };

  return (
    <>
      <h1>Find Music</h1>
      <div>
        <form onSubmit={handleSubmit}>
          <label>Select Genre:</label>
          <select value={selectedGenre} onChange={handleGenreChange}>
            <option value="">Select Genre</option>
            <option value="pop">Pop</option>
            <option value="rap">Rap/Hip-Hop</option>
            <option value="rock">Rock/Metal</option>
            {/* Add other genre options */}
          </select>

          <label>Tempo:</label>
          <select value={tempo} onChange={handleTempoChange}>
            <option value="">Select BPM</option>
            <option value="fast">Fast</option>
            <option value="slow">Slow</option>
            <option value="calm">Calm</option>
          </select>

          <label>Popularity:</label>
          <select value={popularity} onChange={handlePopularityChange}>
            <option value="Niche">Niche</option>
            <option value="Underground">Underground</option>
            <option value="Popular">Popular</option>
            <option value="VeryPopular">Very Popular</option>
          </select>

          <button type="submit" disabled={isLoading}>
            {isLoading ? 'Loading...' : 'Recommend Songs'}
          </button>
        </form>
      </div>

      <div>
        <h3>Recommended Songs</h3>
        <ul>
          {recommendedTracks.map((track, index) => (
            <li key={index}>
              {track.name} - {track.artists.map((artist) => artist.name).join(', ')}
            </li>
          ))}
        </ul>
      </div>
    </>
  );
};

export default FindMusic;
